import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import * as api from '../utils/api';

export default function TeacherDashboard() {
    const [exams, setExams] = useState([]);
    const [loading, setLoading] = useState(true);
    const [error, setError] = useState('');
    const navigate = useNavigate();

    useEffect(() => {
        loadExams();
    }, []);

    const loadExams = async () => {
        try {
            const user = JSON.parse(localStorage.getItem('user') || '{}');
            const response = await api.getExamsByTeacher(user.username || 'teacher1');
            setExams(response.data || []);
        } catch (err) {
            setError('Failed to load exams');
        } finally {
            setLoading(false);
        }
    };

    const toggleExamStatus = async (examId, currentStatus) => {
        try {
            await api.apiClient.patch(`/exams/${examId}/status`, { 
                isActive: !currentStatus 
            });
            loadExams(); // Reload exams
        } catch (err) {
            alert('Failed to update exam status');
        }
    };

    if (loading) return <div>Loading...</div>;

    return (
        <div style={{ padding: '20px', maxWidth: '1000px', margin: '0 auto' }}>
            <div style={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center', marginBottom: '20px' }}>
                <h2>Teacher Dashboard</h2>
                <button 
                    onClick={() => navigate('/exam-creator')}
                    style={{ 
                        padding: '10px 20px', 
                        backgroundColor: '#007bff', 
                        color: 'white', 
                        border: 'none', 
                        borderRadius: '5px',
                        cursor: 'pointer'
                    }}
                >
                    Create New Exam
                </button>
            </div>

            {error && <div style={{ color: 'red', marginBottom: '20px' }}>{error}</div>}

            <div style={{ backgroundColor: '#f8f9fa', padding: '20px', borderRadius: '8px' }}>
                <h3>My Exams</h3>

                {exams.length === 0 ? (
                    <p>No exams created yet. <button onClick={() => navigate('/exam-creator')}>Create your first exam</button></p>
                ) : (
                    <div style={{ display: 'grid', gap: '15px' }}>
                        {exams.map(exam => (
                            <div key={exam.examId} style={{ 
                                border: '1px solid #ddd', 
                                padding: '15px', 
                                borderRadius: '8px',
                                backgroundColor: 'white'
                            }}>
                                <div style={{ display: 'flex', justifyContent: 'space-between', alignItems: 'flex-start' }}>
                                    <div style={{ flex: 1 }}>
                                        <h4 style={{ margin: '0 0 10px 0' }}>{exam.title}</h4>
                                        <p style={{ margin: '0 0 10px 0', color: '#666' }}>{exam.description}</p>
                                        <div style={{ fontSize: '14px', color: '#888' }}>
                                            <span>Duration: {exam.duration} minutes</span>
                                            <span style={{ marginLeft: '20px' }}>
                                                Questions: {exam.questions?.length || 0}
                                            </span>
                                        </div>
                                    </div>

                                    <div style={{ display: 'flex', flexDirection: 'column', gap: '10px', alignItems: 'flex-end' }}>
                                        <div style={{ 
                                            padding: '5px 10px', 
                                            borderRadius: '15px',
                                            fontSize: '12px',
                                            fontWeight: 'bold',
                                            backgroundColor: exam.isActive ? '#d4edda' : '#f8d7da',
                                            color: exam.isActive ? '#155724' : '#721c24'
                                        }}>
                                            {exam.isActive ? 'ACTIVE' : 'INACTIVE'}
                                        </div>

                                        <button
                                            onClick={() => toggleExamStatus(exam.examId, exam.isActive)}
                                            style={{
                                                padding: '8px 16px',
                                                border: 'none',
                                                borderRadius: '5px',
                                                cursor: 'pointer',
                                                fontSize: '14px',
                                                backgroundColor: exam.isActive ? '#dc3545' : '#28a745',
                                                color: 'white'
                                            }}
                                        >
                                            {exam.isActive ? 'Deactivate' : 'Activate'}
                                        </button>
                                    </div>
                                </div>
                            </div>
                        ))}
                    </div>
                )}
            </div>
        </div>
    );
}
